import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>kaitlyn's site!</div>
      </header>
      <div className="row">
        <div className="column1">column 1!
          <div className="nav-list">
            <div className='nav-item'><a href="home" style="color: inherit;" target="_blank">home</a></div>
            <div className='nav-item'><a href="about_me">about me</a></div>
            <div className='nav-item'><a href="my_projects">my projects</a></div>
            <div className='nav-item'><a href="links">links</a></div>
            <div className='nav-item'><a href="fun_stuff">fun stuff</a></div>
          </div>
        </div>
        <div className="column2">column 2!</div>
      </div>
    </div>
  );
}

export default App;
